import React from "react";
import styled from "styled-components";
import NavbarComp from "../components/UI/NavbarComp";
import Head from "next/head";

const services = () => {
  return (
    <div>
      <Head>
        <title>Service</title>
        <link
          href="https://fonts.googleapis.com/css?family=Poppins|Quicksand|Racing+Sans+One&display=swap"
          rel="stylesheet"
        />
      </Head>
      <Container>
        <NavbarComp />
        <BannerBG>
          <div className="banner-title">
            <p>Services</p>
          </div>
        </BannerBG>
        <div className="bg-stripes">
          <svg
            width="1440"
            height="2103"
            viewBox="0 0 1440 2103"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <rect
              width="38.3601"
              height="2668.61"
              rx="8"
              transform="matrix(0.697089 0.716985 -0.806877 0.59072 1649.24 0)"
              fill="#FCB801"
            />
            <rect
              width="38.3601"
              height="2668.61"
              rx="8"
              transform="matrix(0.697089 0.716985 -0.806877 0.59072 1746.68 115.052)"
              fill="#FCB801"
            />
            <rect
              width="38.3601"
              height="2668.61"
              rx="8"
              transform="matrix(0.697089 0.716985 -0.806877 0.59072 2133.26 499.023)"
              fill="#FCB801"
            />
            <rect
              width="278.525"
              height="2668.61"
              rx="10"
              transform="matrix(0.697089 0.716985 -0.806877 0.59072 1868.09 237.036)"
              fill="#FF3838"
            />
          </svg>
        </div>
        <p className="service-intro">
          We provide best-in-class services in your budget
        </p>
      </Container>
      <style jsx global>{`
        body {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
        }
      `}</style>
    </div>
  );
};

export default services;

const Container = styled.div`
  width: 100vw;
  line-height: 1.3;
  margin: 0;
  background-color: #151515;
  height: 200vh;
  position: relative;
  .bg-stripes {
    position: absolute;
    z-index: -10;
  }
  .service-intro {
    font-family: Quicksand;
    font-style: normal;
    font-weight: 500;
    font-size: 50px;
    line-height: 62px;
    text-align: center;
    letter-spacing: 0.055em;
    color: #fcfcfc;
    width: 40%;
    margin: 0 auto;
    margin-top: 5vh;
  }
`;
const BannerBG = styled.div`
  width: 100vw;
  height: 60vh;
  background: url("/static/images/service/service-banner.png") bottom center
    no-repeat;
  background-size: cover;
  .banner-title {
    height: 60%;
    width: 100%;
    background: rgba(67, 67, 67, 0.44);
    height: 60%;
    transform: translate3d(0, 35%, 0);
  }
  p {
    font-family: Quicksand;
    font-style: normal;
    font-weight: normal;
    font-size: 100px;
    line-height: 125px;
    text-align: center;
    letter-spacing: 0.725em;
    transform: translate3d(0, 65%, 0);
    color: #ffffff;
  }
`;
